import React from 'react';
import { Container, Typography } from '@mui/material';

const RaporCalistir = () => {
    return (
        <Container>
            <Typography variant="h4" gutterBottom>
                Rapor Çalıştır
            </Typography>
            <Typography>Bu bölümde rapor çalıştırabilirsiniz.</Typography>
        </Container>
    );
};

export default RaporCalistir;
